description:
Frogstomp is the debut album of Australian rock band Silverchair.
 It was released in Australia in early 1995, when the members were only 15 years of age, by Murmur Records and reached number one on the album charts.

 On 20 June 1995, Frogstomp was released by Epic Records in the U.S. and has been certified double platinum by the (RIAA aka The most hated.) 

On 27 March 2015 the album was remastered and re released as a two CD/DVD set to mark the twentieth anniversary of its release.

